import React from 'react';
import ReactDOM from 'react-dom';
import './MyApp.css';
import logo from './dccs.png';
import {FiSearch} from 'react-icons/fi';


class ApplicantList extends React.Component {
	constructor(props){
		super(props);
		this.state = {names: []}; //array of applicant names
		this.namesf = this.namesf.bind(this);

	}
	namesf(){
		return ["Name One","Name Two"];
	}

  render(){
	  this.setState({names: this.namesf()});
    return(
      <div id="mainListDiv">
        <p> Showing results in my app </p>
        {this.state.names.map(n => <p>{n}</p>)}
      </div>
    );
  }
}

class SearchBar extends React.Component {
  render(){
    return(
      <div id="searchBar">
        <div id="logoDiv">
          <img id="logoImg"src={logo}/>
        </div>
        <div id="inputDiv">
          <spam><FiSearch/></spam>
          <input id="searchInput" type="text"/>
        </div>
      </div>
    );
  }
}

class MyApp extends React.Component {
  render(){
    return(
      <div id="mainDiv">
        <SearchBar />
        <ApplicantList />
      </div>
    );
  }
}

export default MyApp;
